import { useState } from "react";
import { InputBase } from "../styles/Input";

export const Input = ({ props }: any) => {
  const [value, setValue] = useState("koko");
  return (
    <InputBase
      {...props}
      value={value}
      onChange={(newValue) => setValue(newValue)}
    ></InputBase>
  );
};
